SELECT MAX("info_type"."id") as agg_0, SUM("title"."id") as agg_1 FROM "info_type" LEFT OUTER JOIN "movie_info_idx" ON "info_type"."id" = "movie_info_idx"."info_type_id" LEFT OUTER JOIN "title" ON "movie_info_idx"."movie_id" = "title"."id" LEFT OUTER JOIN "movie_keyword" ON "title"."id" = "movie_keyword"."movie_id"  WHERE "movie_info_idx"."movie_id" <= 1943566 AND "movie_info_idx"."info_type_id" != 99 AND "info_type"."info" NOT LIKE '%q%uality%' AND "title"."title" LIKE '%o%f%' AND "title"."episode_of_id" <= 168292.36593515967 AND "movie_keyword"."id" >= 3802778;